#import "WKWebView+HotelsCombined.h"

@implementation WKWebView (HotelsCombined)

static NSString *_loadingPageHtml = @"<html><head><meta charset='UTF-8'><meta name='viewport' content='width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no' /><style>body { margin:0; font-family:'Helvetica Neue',Helvetica,Arial,sans-serif; } div.header { background:#00AEF1; height:36px; padding-top:14; } div.logo { background-position:center center; background-repeat:no-repeat; width:100%; height:20px; background-size:contain; background-image:url(data:image/png;base64,%3D); } div.image { background-position:center center; background-repeat:no-repeat; background-size:cover; width:100%; height:88px; background-image:url(data:image/jpeg;base64,%3D); } div.loading { height:400; background-position:center center; background-repeat:no-repeat; background-image:url(data:image/gif;base64,%3D%3D); }</style></head><body><div class='header'><div class='logo'></div></div><div class='image'></div><div class='loading'></div></body></html>";

- (void)loadLoadingPage {
	[self loadHTMLString:_loadingPageHtml baseURL:[NSURL URLWithString:@""]];
}

- (void)loadBlankPage {
	[self loadHTMLString:@"" baseURL:[NSURL URLWithString:@""]];
}

@end
